const TelemetryHandler = () => {
  const [telemetryData, setTelemetryData] = useState({});
  
  useEffect(() => {
    const ws = new WebSocket('wss://api.spacex.com/telemetry');
    
    ws.onmessage = (event) => {
      const data = JSON.parse(event.data);
      setTelemetryData(prev => ({
        ...prev,
        [data.parameter]: {
          value: data.value,
          timestamp: data.timestamp,
          status: data.status
        }
      }));
    };
    
    return () => ws.close();
  }, []);
  
  return (
    <TelemetryDisplay data={telemetryData} />
  );
};`,challenges:["Handling high-frequency real-time data streams","Ensuring zero-latency critical alerts","Managing complex 3D visualizations performance","Synchronizing multiple data sources"],solutions:["Implemented WebSocket connection pooling","Used Web Workers for background processing","Optimized Three.js rendering with LOD","Created custom data synchronization layer"]},{id:"cosmic-database-explorer",title:"Cosmic Database Explorer",description:"An interactive tool for exploring astronomical databases with advanced filtering, visualization, and data export capabilities.",longDescription:"A powerful data exploration platform that connects to multiple astronomical databases including NASA's exoplanet archive, stellar catalogs, and deep space object databases. Features advanced search capabilities, interactive visualizations, and comprehensive data export options for researchers and space enthusiasts.",image:"https://images.pexels.com/photos/1252890/pexels-photo-1252890.jpeg?auto=compress&cs=tinysrgb&w=800",technologies:["Next.js","PostgreSQL","GraphQL","Chart.js","Python","FastAPI"],github:"https://github.com/cosmic/database-explorer",live:"https://cosmic-explorer.vercel.app",icon:Wg,features:["Multi-database query interface","Advanced filtering and search","Interactive data visualizations","Custom chart generation","Data export in multiple formats","Collaborative research tools"],codeSnippet:`// GraphQL resolver for astronomical data
